// Disable right-click
document.addEventListener('contextmenu', e => e.preventDefault());

// Disable DevTools shortcuts
document.onkeydown = function (e) {
  if (
    e.keyCode === 123 || 
    (e.ctrlKey && e.shiftKey && (e.keyCode === 73 || e.keyCode === 67 || e.keyCode === 74)) || 
    (e.ctrlKey && e.keyCode === 85) 
  ) {
    return false;
  }
};


